import { isValidCredential } from "./isValidCredential";

describe("isValidCredential", () => {
  it("should return 'true' when credential is valid", async () => {
    expect(await isValidCredential(mdoc)).toEqual(true);
  });

  it("should throw 'INVALID_MDL' error when mDoc fails to CBOR-decode", async () => {
    const credential = "invalidCbor";

    await expect(isValidCredential(credential)).rejects.toThrow(
      "INVALID_MDL: Failed to decode CBOR data - Insufficient data",
    );
  });
});

